import react, {Component} from 'react';
import Navbar from '../components/navbar/Navbar';

const DefaultLayout =
    (Component) =>
        ({...props}) => {
            return (
                <div>
                    <Navbar/>
                    <Component {...props} />
                    <div>Footer</div>
                </div>
            );
        };

export default DefaultLayout;
